import { ADD_LIST, CHANGE_LIST_NUM } from './action-type'
import store from '../store/store'
export default {
    addList() {
        let action = {
            type: ADD_LIST
        }
        return action
    },
    changeNum(params) {
        let action = {
            type: CHANGE_LIST_NUM,
            params: params
        }
        store.dispatch(action)
    }
}
